const fs = require("fs");
const parseUrl = require("url").parse;
const parseFileName = require("path").parse;

let promises = [];
urls.forEach(url => {
    promises.push(request.get(url).pipe(fs.createWriteStream(parseFileName(parseUrl(url).pathname).base)));
});
Promise.all(promises).then(() => {
    console.log("Done.");
});